import { Button } from 'bootstrap';
import React from 'react';

const Login = () => {
  return (
    <div>
      <form className="form-control">
        <input type="text" className="form-control" placeholder="username" />
        <input
          type="password"
          className="form-control"
          placeholder="password"
        />
        <Button>Login</Button>
      </form>
    </div>
  );
};

export default Login;
